import React from "react";
import Heading from "./Heading";
import Banner from "./Homebanner";
import Tabs from "./Tabs";
import Footer from "./Footer";

import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

function Home() {
  return (
    <div className="App"> 
      <Heading />
      <Homebanner />
      <Tabs />
      <Footer />
      
    </div>
  );
}

export default Home;
